<h1>Kano bunchy jump</h1>
<p><b>Location</b>: Water at Oreganoweg and Melissepad
<br><b>Number of participants</b>: 8 participants per team
<br><b>Number of boats</b>: 4 x canoe (2 canoes per team)
<br><b>Maximum playing time</b>: 20 minutes
<br><b>Penalty</b>: time 2 minutes for each participant who enters the water1 minute for not rounding a buoy</p>

<h2>How to play</h2>
<p>Two teams at the same time &#8594; 2 x 2 canoes with 4 people each.</p>
<h3>Team 1</h3>
<ol>
<li>Lift/drag the canoes from the starting area to A</li>
<li>Put the canoes in the water and paddle to B</li>
<li>Put the canoes on shore</li>
<li>All participants via the suspension beams on the bridge from B to C (see attachment)</li>
<li>Walk back across the bridge from C to B</li>
<li>The canoes back in the water and paddle to D</li>
<li>Pull the canoes out of the water and lift the canoes to E</li>
<li>The canoes at E weather and paddle to G (surprise)</li>
<li>All participants climb back into the canoes at G and paddle back to E</li>
<li>The canoes out of the water and back to the finish.</li>
<li>The time stops when everyone, including the canoes, is in the finish area.</li>
</ol>
<h3>Team 2</h3>
<ol>
<li>Lift/drag the canoes from the starting area to E</li>
<li>The canoes in the water and then paddle to G (surprise)</li>
<li>All participants climb back into the canoes at G and paddle back to E</li>
<li>Get the canoes out of the water and lift the canoes to A</li>
<li>Put the canoes in the water and paddle to B</li>
<li>Put the canoes on shore</li>
<li>All participants via the suspension beams on the bridge from B to C (see attachment)</li>
<li>Walk back across the bridge from C to B</li>
<li>Get the canoes back in the water and paddle to A</li>
<li>Take the canoes out of the water and back to the finish line</li>
<li>Time stops when everyone, including the canoes, is in the finish area.</li>
</ol>

<br><emp>NB: If participants deliberately hinder each other, a time penalty will follow!!</emp>
<ul>
<li>If a team has to wait for the opponent for an obstacle, the waiting team's time is stopped.</li>
</ul>

